import React from "react";
import { Row } from 'shards-react';

export default ({ chats }) => (
  <ul>
    {chats.map(chat => {
      return (
        <div>
          <Row>
              <div>
                <div key={chat.id} >
                  <p>
                    <strong>{chat.username}</strong>
                  </p>
                  <p>{chat.message}</p>
                </div>
              </div>
          </Row>
        </div>
      );
    })}
  </ul>
);
